import { useState } from 'react'
import Video from './SubComponents/Video';

function Content() {
  //Search bar
  const [searchData, setSearchData] = useState('');
  
  const handleSearchChange = (event) => {
    setSearchData(event.target.value);
  };

  //Faculty
  const [facultychecked, setFacultyChecked] = useState([]);
  const facultyList = ["Kohli", "David", "Sharma", "Singh", "Chopra"];

  const handlefacultyCheck = (event) => {
    var updatedfacultyList = [...facultychecked];

    if(event.target.checked) {
      updatedfacultyList = [...facultychecked, event.target.value];
    } 
    else {
      updatedfacultyList.splice(facultychecked.indexOf(event.target.value), 1);
    }
    setFacultyChecked(updatedfacultyList);
  };

  const facultycheckedItems = facultychecked.length 
    ? facultychecked.reduce((total, item) => {
        return total + ", " + item;
      })
    : "";

  const isfacultyChecked = (item) =>
    facultychecked.includes(item) ? "checked-item" : "not-checked-item";


  //Domain
  const [domainchecked, setDomainChecked] = useState([]);
  const domainList = ["Social", "History", "Physics", "Finance", "Chemistry"]

  const handledomainCheck = (event) => {
    var updatedfacultyList = [...domainchecked];

    if(event.target.checked) {
      updatedfacultyList = [...domainchecked, event.target.value];
    } 
    else {
      updatedfacultyList.splice(domainchecked.indexOf(event.target.value), 1);
    }
    setDomainChecked(updatedfacultyList);
  };

  const domaincheckedItems = domainchecked.length 
    ? domainchecked.reduce((total, item) => {
        return total + ", " + item;
      })
    : "";

  const isdomainChecked = (item) =>
    domainchecked.includes(item) ? "checked-item" : "not-checked-item";


  //Video Details
  const [myData, setMyData] = useState([])
  const [isError, setIsError] = useState("")

  const getMyPostData = async () => {
    try {
      const res = await axios.get("/posts")
      setMyData(res.data)
    } catch (error) {
      setIsError(error.message)
    }
  }



  return (
    <section class="container">
      <div class="input-Filter">        
        <div class="search-input">
          <input type="text" id="searchData" name="searchData" placeholder="Search" onChange={handleSearchChange}/>
          <h2>Search: {searchData}</h2>
        </div>

        <div class="faculty">
          <div class="faculty-facultyList">
            <div class="faculty-title">Faculty</div>
            <div class="faculty-list-container">
              {
                facultyList.map((item, index) => (
                  <div key={index}>
                    <input value={item} type="checkbox" onChange={handlefacultyCheck} />
                    <span class={isfacultyChecked(item)}>{item}</span>
                  </div>
                ))
              }
            </div>
          </div>
          <div>
            {`Items checked are: ${facultycheckedItems}`}
          </div>
        </div>

        <div class="domain">
          <div class="domain-domainList">
            <div class="domain-title">Faculty</div>
            <div class="domain-list-container">
              {
                domainList.map((item, index) => (
                  <div key={index}>
                    <input value={item} type="checkbox" onChange={handledomainCheck} />
                    <span class={isdomainChecked(item)}>{item}</span>
                  </div>
                ))
              }
            </div>
          </div>
          <div>
            {`Items checked are: ${domaincheckedItems}`}
          </div>
        </div>
      </div>

      <div class='content'>
        <div class='display-video'>
          <Video/>
        </div>
      </div>
    </section>
  )
}

export default Content
